      "description": "IMPORTANT INFORMATION:\n\nDuring Christmas Holidays, please make sure that you place the order beforehand so that you can get the parcel in time for the holidays. Postal services may be overloaded on such periods, and I cannot guarantee timely delivery.\n\n\nI can personalize a wooden box, a decanter and glasses.\nDo not forget to write in the notes of the characters you chose if you did not order the complete set.\nPlease write me your wishes in the notes to the order.\n\nDescription:\n\nAll the whiskey sets that we make are made with love and attention. Our stylish glasses and decanters will serve their owner for many years to come. We make our glasses from best materials available, and use the top quality European glass. This whiskey set will become the most suitable present for any event – including a wedding, engagement or a birthday party. We are sure that your friends are going to love this present.\n\nWe will customize the whisky set special for you and make it unique and perfectly fit for the occasion. The number of glasses can vary according to your needs. Eventually, you will get the perfect result. To order a personalized whiskey set, please specify your wishes in the comments to the order. All the glasses and decanters are made from best materials available. The picture quality we provide is also high, as we use the latest laser technologies.\n\n\nLink to our store Gift Shop:\n****************************************************************************\nwww.etsy.com/shop/LuxuriousGiftShop\n****************************************************************************\n--------------------------------------------------------------------------------------------------------------------------------------\nSize:\nDecanter holds 500 ml\nEach glass holds 205 ml\n--------------------------------------------------------------------------------------------------------------------------------------\nHow to order:\n1.Select quantity\n2.Select set\n3.Click &#39;Add to card&#39;\n4.Finish purchase\n\nPlease see more:\n\nStar Wars : https://www.etsy.com/listing/510116223\nStar Wars : https://www.etsy.com/listing/503965559\n\nGame of Thrones : https://www.etsy.com/listing/505538163\n\nHarry Potter : https://www.etsy.com/listing/510138857\nHarry Potter : https://www.etsy.com/listing/496652466\n___________________________________________________________________________________________\nSHIPPING INFORMATION\nEstimated shipping times\nNorth America: 7-10 business days in some cases it can take up to 21 business days. It all depends from USPS\nEurope: 7-12 business days\nAustralia, New Zealand and Oceania: 10-21 business days\nAsia Pacific: 10-14 business days\n\n• Shipping Worldwide from Ukraine\n• I ship within 2-7 business days after receipt of payment.\n• Item will be qualitatively packed\n• Parcels with tracking numbers\n\nPlease feel free to ask questions.",
