        "policy_refunds": "RETURNS:\r\nI will accept returns. Please contact me within 7 days of receiving your package if you are looking to make a return. In order to return an item, you must ship the package back to me at your expense, and the item must arrive in good, unused condition. I will then offer a refund of the purchase price of the item (without shipping cost).\r\n\r\nLOST OR DAMAGED:\r\nIf your items arrive damaged, or if your package was shipped out and got lost and never arrived, please contact me. I will work with you to come up with a solution to fix this.\r\n\r\nIf we make a mistake with your order we will do all we can to fix it. If there is a problem with your order please write me a message before leaving feedback so that I can work with you to resolve the matter.\r\n",
